import React from 'react';
import Chatbot from '../components/Chatbot';

const coFounders = [
    { name: 'Alice Johnson', image: 'path/to/alice.jpg' },
    { name: 'Bob Smith', image: 'path/to/bob.jpg' },
    { name: 'Charlie Brown', image: 'path/to/charlie.jpg' },
    { name: 'Diana Prince', image: 'path/to/diana.jpg' },
    { name: 'Ethan Hunt', image: 'path/to/ethan.jpg' },
    { name: 'Fiona Gallagher', image: 'path/to/fiona.jpg' },
];

const Home = () => (
    <div>
        <h1>Welcome to MicroBiomy</h1>
        <section>
            <h2>Our Mission</h2>
            <p>At MicroBiomy, our mission is to revolutionize the way we understand and interact with the microbiome. We aim to provide cutting-edge solutions that enhance health and well-being through microbiome research and technology.</p>
        </section>
        <section>
            <h2>About Our Product</h2>
            <p>Our product leverages advanced microbiome analysis to offer personalized health insights and recommendations. By understanding the unique composition of your microbiome, we help you make informed decisions about your diet, lifestyle, and overall health.</p>
        </section>
        <section>
            <h2>Meet Our Co-Founders</h2>
            <div style={{ display: 'flex', flexWrap: 'wrap' }}>
                {coFounders.map((founder, index) => (
                    <div key={index} style={{ margin: '10px', textAlign: 'center' }}>
                        <img src={founder.image} alt={founder.name} style={{ width: '150px', height: '150px', borderRadius: '50%' }} />
                        <h3>{founder.name}</h3>
                    </div>
                ))}
            </div>
        </section>
        {/* <Chatbot /> */}
    </div>
);

export default Home;
